import React, { Component } from 'react';

class Index extends Component {
    render() {
        return(
            <div>
                <p>{this.props.customers.first_name}</p>
                <p>{this.props.customers.last_name}</p>
                <p>{this.props.customers.home_city}</p>
            </div>

        )
    }   
}

export default Index;
